import { useState } from "react";
import './AntiqueForm.css'
import {useNavigate} from 'react-router-dom'
export default function AntiqueForm({submitHandler,initialFields}){
const navigate = useNavigate();

const [form,setForm] = useState(initialFields);

const changeHandler = e => {
    setForm({...form,[e.target.name]:e.target.value });
}



    return (
<div className="form-container">
    <h3 className="title-container">Create New Antique</h3>
    <form className="form-actual"
     onSubmit={(e)=>{
        e.preventDefault();
        console.log('submit Clicked',form)
        submitHandler(form);
        setForm(initialFields)
        // navigate.push('/antiques')
        }}>
    <div className="inputList-container">
        <input id="category"   name="category"    type="text" placeholder="Category"    className="inputList-input" onChange={changeHandler} value={form.category}    maxLength="20"    aria-label="category input box" />
        <input id="quantity"   name="quantity"    type="text" placeholder="Quantity"    className="inputList-input" onChange={changeHandler} value={form.quantity}    maxLength="20"    aria-label="quantity input box" />
        <input id="name"       name="name"        type="text" placeholder="Name"        className="inputList-input" onChange={changeHandler} value={form.name}        maxLength="20"    aria-label="name input box" />
        <input id="value"      name="value"       type="text" placeholder="Value"       className="inputList-input" onChange={changeHandler} value={form.value}       maxLength="20"    aria-label="value input box" />
        <input id="material"   name="material"    type="text" placeholder="Material"    className="inputList-input" onChange={changeHandler} value={form.material}    maxLength="20"    aria-label="material input box"/>
        <input id="color"      name="color"       type="text" placeholder="Color"       className="inputList-input" onChange={changeHandler} value={form.color}       maxLength="20"    aria-label="color input box" />
        <input id="style"      name="style"       type="text" placeholder="Style"       className="inputList-input" onChange={changeHandler} value={form.style}       maxLength="20"    aria-label="style input box" />
        <input id="brand"      name="brand"       type="text" placeholder="Brand"       className="inputList-input" onChange={changeHandler} value={form.brand}       maxLength="20"    aria-label="brand input box" />
        <input id="model"      name="model"       type="text" placeholder="Model"       className="inputList-input" onChange={changeHandler} value={form.model}       maxLength="20"    aria-label="model input box" />
        <input id="timePeriod" name="timePeriod"  type="text" placeholder="Time Period" className="inputList-input" onChange={changeHandler} value={form.timePeriod}  maxLength="20"    aria-label="time period input box" />
        <input id="condition"  name="condition"   type="text" placeholder="Condition"   className="inputList-input" onChange={changeHandler} value={form.condition}   maxLength="20"    aria-label="condition input box" />
        <input id="origin"     name="origin"      type="text" placeholder="Origin"      className="inputList-input" onChange={changeHandler} value={form.origin}      maxLength="20"    aria-label="origin input box" />
        <input id="purpose"    name="purpose"     type="text" placeholder="Purpose"     className="inputList-input" onChange={changeHandler} value={form.purpose}     maxLength="50"    aria-label="purpose input box" />
        <input id="owner"      name="owner"       type="text" placeholder="Owner"       className="inputList-input" onChange={changeHandler} value={form.owner}       maxLength="20"    aria-label="owner input box" />
        <input id="history"    name="history"     type="text" placeholder="History"     className="inputList-input" onChange={changeHandler} value={form.history}     maxLength="100"   aria-label="history input box" />
        <input id="size"       name="size"        type="text" placeholder="Size"        className="inputList-input" onChange={changeHandler} value={form.size}        maxLength="20"    aria-label="size input box" />
        <input id="comment"    name="comment"     type="text" placeholder="Comment"     className="inputList-input" onChange={changeHandler} value={form.comment}     maxLength="100"   aria-label="comment input box" /> 
    </div>
    <button className="inputList-btn">Submit</button>
    </form>

</div>)
}
